MATCH (e:Encounter)-[:RELATES_TO]->(s:Supply) 
WHERE s.code = '337388004' 
RETURN e.facility, e.notes;

MATCH (s:Supply)-[:RELATED_TO]->(e:Encounter) 
WHERE s.name="Face shield (physical object)" 
RETURN DISTINCT e.id;

MATCH (p:Procedure)-[:PERFORMED_BY]->(:Patient {firstName: 'Rhianna', lastName: 'Emerson'}) 
WHERE p.code = '171207006' 
RETURN p.startDate;

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy) 
WHERE a.name = "Aspirin" 
RETURN DISTINCT p.firstName,p.lastName;

MATCH (p:Person)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.code = '288328004'
RETURN DISTINCT p.firstName, p.lastName;

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.description = 'Allergy to substance (finding)'
RETURN count(DISTINCT p);

MATCH (a:Allergy)-[:IS_REACTION_OF]->(f:Finding)
WHERE a.name = 'Allergy to substance (finding)'
RETURN f.name;

MATCH (i:Immunization)
WHERE (i)-[:IS_COVERED_BY]->(:Payer {name: "Humana"}) AND NOT (i)-[:IS_COVERED_BY]->(:Payer {name: "Medicare"})
RETURN COUNT(i);

MATCH (m:Medication)<-[:PRESCRIBED]-(e:Encounter)<-[:SEEN_BY]-(d:Doctor) 
            WHERE m.name CONTAINS 'verapamil hydrochloride 80 MG Oral Tablet' 
            RETURN DISTINCT e.id, e.location,d.firstName, d.lastName;

MATCH (p:Patient)-[:HAS_ALLERGY]->(a:Allergy)
WHERE a.code="256355007"
RETURN DISTINCT p.firstName, p.lastName;
